import React from 'react'

function Login (props) {
  function handleLogin () {
    props.on
  }
  return (
    <>
      <h1>Please Sign In</h1>
      <button onClick={handleLogin}>Login</button>
    </>
  )
}

function SignUp () {
  return (
    <>
      <h1>Welcome Back</h1>
      <button>Sign Up</button>
    </>
  )
}

class App extends React.Component {
  constructor () {
    super()
    this.state = {
      toggle: true
    }
  }

  handleLogin () {
  }

  render () {
    if (this.state.toggle) return <Login onLogin={() => this.handleLogin()} />
    return <SignUp />
  }
}

export default App
